						<p className="text-center pt-4">This is an app that lets you add cats, their feeding schedules, and toys that can be associated with a cat using 1 to many and many to many relationships. You are also able to use AWS S3 to upload photos your cats. This app uses Django/PostgreSQL, supports authentication and authorization, and uses Materialize for styling.</p>
